import Link from "next/link";
import Layout from "../components/layout/Layout";

const hireme = () => {
  return (
    <Layout title="Hire me">
      <div>
        <p>
          <a href="mailto:olanrewajuranda@gmail.com">Send a message</a>
        </p>
      </div>
    </Layout>
  );
};

export default hireme;
